eval("module.exports = JSON.parse(\"{\\\"intro\\\":{\\\"title\\\":\\\"Start\\\",\\\"info\\\":\\\"Student, Entwickler, Zukünftiger IT-Sicherheit Experte\\\",\\\"skip\\\":\\\"Überspringen\\\",\\\"hintClick\\\":\\\"Klick mich!\\\"},\\\"aboutme\\\":{\\\"title\\\":\\\"Über mich\\\",\\\"myinfo\\\":[\\\"Hi,<br/>Ich bin 23 und studiere zurzeit M.Sc. IT-Sicherheit an der Technischen Universität Darmstadt.\\\",\\\"<br/><br/>Informatik und generell Computer sind schon lange meine Leidenschaft und \\\",\\\"durch meinen Bachelor in Informatik bin ich mit vielen Bereichen der Informatik in Berührung gekommen. \\\",\\\"Dabei haben vor allem die Themen Sicherheit und Software Entwicklung meine Begeisterung geweckt.<br/><br/>\\\",\\\"Bezüglich der Sicherheit faszinieren mich die technische Themen Web- und Netzwerksicherheit, und \\\",\\\"Kryptographie, aber auch das Thema Informationssicherheitsmanagement, das scheinbar zu \\\",\\\"wenige Unternehmen ernst nehmen.<br/><br/>Mit einer großen Begeisterung Neues zu lernen und mit meinen \\\",\\\"Interessen in der Sicherheit, so wie der Entwicklung, will ich die IT-Systeme sicherer machen.\\\"]},\\\"skills\\\":{\\\"title\\\":\\\"Fähigkeiten\\\",\\\"general\\\":{\\\"title\\\":\\\"Allgemein\\\",\\\"content\\\":[\\\"Mit einer großen Begeisterung für die Informatik und vor allem für Software Entwicklung \\\",\\\"und Sicherheit habe ich mit viel Enthusiasmus mein Studium an der TU Darmstadt angefangen.<br/><br/>\\\",\\\"Seitdem habe ich viel Wissen in den unterschiedlichen Bereichen der Informatik gelernt und ein Vielzahl\\\",\\\" von Projekten, sowohl in der Uni, also auch persönliche, gemeistert. \\\",\\\"Durch diese Projekte habe ich außerdem viel Erfahrung in Themen wie <strong>git</strong>, \\\",\\\"<strong>Agile Entwicklung</strong>, <strong>Teamarbeit</strong> und unterschiedlichen \\\",\\\"Programmiersprachen gesammelt.<br/><br/>In meiner Freizeit beschäftige ich mich auch gerne mit \\\",\\\"Aufgaben in Hacking Events wie CTFs oder Hack-the-box und halte mich stetig auf dem laufendem.\\\"]},\\\"coding\\\":{\\\"title\\\":\\\"Programmiersprachen\\\",\\\"content\\\":\\\"Die folgende Liste enthält alle Sprachen die ich beherrsche in absteigender Expertise\\\",\\\"langlist\\\":{\\\"javascript\\\":\\\"JavaScript (normal, Reactjs, Nodejs)\\\",\\\"python\\\":\\\"Python (in meiner Bachelorarbeit verwendet)\\\",\\\"c++\\\":\\\"C++ (habe ich als HiWi gelehrt)\\\",\\\"java\\\":\\\"Java\\\",\\\"rust\\\":\\\"Rust\\\",\\\"bash\\\":\\\"Bash\\\",\\\"brainfuck\\\":\\\"Brainfuck\\\",\\\"lowest\\\":\\\"Anfänger\\\",\\\"highest\\\":\\\"Profi\\\"}},\\\"experience\\\":{\\\"title\\\":\\\"Erfahrung\\\",\\\"introduction\\\":[\\\"Durch Projekte in der Uni, aber vor allem durch eigene Projekte habe ich in vielen Programmiersprachen, Frameworks und Themen Erfahrung gesammelt.<br/>\\\",\\\"Eine komplette Liste mit allen nennenswerten Projekten befinden sich auf der Seite <strong>Projekte</strong>.<br/><br/>\\\"],\\\"projectTopics\\\":{\\\"introduction\\\":\\\"Durch diese Projekte, habe ich viel Erfahrung in den folgenden Bereichen gemacht:\\\",\\\"topics\\\":[\\\"Docker\\\",\\\"Continuous Integration\\\",\\\"Agile Entwicklung\\\",\\\"DevOps\\\",\\\"SysAdmin\\\",\\\"Dokumentation\\\",\\\"Software Design\\\"]},\\\"uniTopics\\\":{\\\"introduction\\\":\\\"Außerhalb dieser Projekte habe ich durch mein Studium auch Erfahrung in den folgenden Themen gesammelt:\\\",\\\"topics\\\":[\\\"Algorithmen\\\",\\\"Robotik\\\",\\\"Kryptographie\\\",\\\"Hardware Programmierung (System Verilog & Bluespec Verilog)\\\",\\\"Compilerbau\\\",\\\"Informationssicherheitsmanagement\\\",\\\"Parallelisierung\\\",\\\"Visual Computing\\\",\\\"Künstliche Intelligenz\\\",\\\"Blockchain und Smart Contract Entwicklung\\\",\\\"Datenbank\\\",\\\"Natural Language Processing\\\",\\\"Rechnerarchitektur\\\"]},\\\"securityTopics\\\":{\\\"introduction\\\":\\\"Außerdem habe ich durch die Uni und teilweise auch eigene Recherche Wissen in den folgenden Sicherheitsthemen angereichert:\\\",\\\"topics\\\":[\\\"Kryptographie\\\",\\\"Netzwerksicherheit\\\",\\\"Websicherheit\\\",\\\"Informationssicherheitsmanagement\\\",\\\"Hardwaresicherheit\\\",\\\"Statische Programmanalyse\\\"]}},\\\"languages\\\":{\\\"title\\\":\\\"Sprachen\\\",\\\"content\\\":[\\\"<strong>Deutsch</strong>: Muttersprachlich<br/>\\\",\\\"<strong>Englisch</strong>: Fliesend (Leistungskurs im Gymnasium)<br/>\\\",\\\"<strong>Japanisch</strong>: Anfänger (Zwei Sprachkurse in der Uni belegt)\\\"]}},\\\"projects\\\":{\\\"title\\\":\\\"Projekte\\\",\\\"type\\\":{\\\"title\\\":\\\"Projektumfang\\\",\\\"app\\\":\\\"App\\\",\\\"server\\\":\\\"Server\\\",\\\"website\\\":\\\"Webseite\\\"},\\\"portfolio\\\":{\\\"title\\\":\\\"Portfolio\\\",\\\"intro\\\":{\\\"title\\\":\\\"Kurze Beschreibung\\\",\\\"content\\\":[\\\"Dieses Projekt betrachtest du gerade. Dieses Projekt war eine Portfolio Webseite zubauen in der ich mich, meine Erfahrungen und Projekte vorstelle.\\\",\\\"Diese Webseite ist sowohl in Deutsch als auch in Englisch verfügbar und wurde mit einem <strong>Responsive</strong> Layout designt.\\\"]},\\\"structure\\\":{\\\"title\\\":\\\"Aufbau\\\",\\\"content\\\":[\\\"<p>Gebaut habe ich diese Webseite mithilfe von <strong>NextJS (ReactJS)</strong>, <strong>Typescript</strong> und <strong>TailwindCSS</strong>. \\\",\\\"Alle Komponenten, Animationen, Icons und Designs sind von mir selbst entworfen und implementiert. \\\",\\\"Meist mit standardisierten Interfaces versehen um diese wiederverwendbar zu gestalten.</p>\\\",\\\"<p>Um diese Webseite zu hosten benutze ich eine <strong>Droplet (Server)</strong> von <0>DigitalOcean</0>, auf der ich alle meine öffentlichen Webseiten verwalte. \\\",\\\"Auf diesem Server war anfänglich nur Ubuntu drauf und wurde von mir soweit konfiguriert, dass ich darüber mehrere Webseite auf unterschiedlichen Domains und Subdomains hosten kann.\\\",\\\"Das Haupttool hierfür war <1>NGINX</1>. Mehr zu diesem Thema habe ich in dem Projekt \\\\\\\"Group Car\\\\\\\" erklärt.</p>\\\"]}},\\\"groupcar\\\":{\\\"title\\\":\\\"My Group Car\\\",\\\"intro\\\":{\\\"title\\\":\\\"Beschreibung\\\",\\\"content\\\":[\\\"Wer sich schonmal ein Auto mit vielen Personen ohne festen Parkplatz teilen musste, \\\",\\\"kennt diese nervige ständige Frage vielleicht: <strong>„Wo steht das Auto??“</strong><br/>\\\",\\\"Da ich diese Frage jedes mal stellen musste, wenn ich in meiner Familie das Auto benutzen wollte, \\\",\\\"habe ich die Webseite <i>„My Group Car“</i> entwickelt mit der man das gemeinsame Auto verwalten kann.\\\",\\\"Mit <i>„My Group Car“</i> kann man Gruppen erstellen, die Familie oder Freunde einladen, \\\",\\\"die gemeinsamen Autos hinzufügen und den Standort der Autos verwalten. Mithilfe von Echtzeit-Updates \\\",\\\"kann man den neuen Standort eines Autos sofort einsehen, sobald dieser eingetragen wurde.\\\"]},\\\"technologies\\\":{\\\"title\\\":\\\"Benutze Technologien\\\",\\\"introduction\\\":[\\\"<p><i>„My Group Car“</i> ist neben TrutzBox wohl das größte Projekt das ich alleine gebaut habe. \\\",\\\"Das liegt daran, dass ich hierfür sowohl eine Webseite als auch einen Server bauen musste. \\\",\\\"Um die Codebase konsistent zu halten habe ich mich dafür entschieden dass Frontend mit \\\",\\\"<0>ReactJS</0> und das Backend mit <1>ExpressJS (auf NodeJS basierend)</1> zubauen.\\\"],\\\"frontend\\\":{\\\"title\\\":\\\"Das Frontend\\\",\\\"content\\\":[\\\"Das Frontend habe ich mithilfe von <strong>ReactJS</strong> gebaut \\\",\\\"und die Bibliothek <2>MUI</2> für das Design genutzt. <2>MUI</2> bietet eine Vielzahl \\\",\\\"von Komponenten an, die sich das <strong>Material</strong> Designkonzept orientieren. \\\",\\\"Für einen angenehmeres Navigieren benutze ich hier <3>React Router</3>. Zum verwalten von \\\",\\\"globalen Zuständen, wie z.B. ob der Benutzer angemeldet ist, benutze ich <4>React Redux</4>. \\\",\\\"Außerdem habe ich <5>Sentry</5> integriert um das Frontend auf mögliche Fehler überwachen zu können. \\\",\\\"Wie in der Einleitung erwähnt, werden Echtzeit-Updates benutzt um Änderungen von Autos direkt \\\",\\\"sehen zu können. Hierfür benutze ich <6>Socket.IO</6>.\\\"]},\\\"backend\\\":{\\\"title\\\":\\\"Das Backend\\\",\\\"content\\\":[]}},\\\"structure\\\":{\\\"title\\\":\\\"Aufbau und Entwicklungsfluss\\\",\\\"content\\\":[\\\"<p>In diesem Projekt habe ich viel Mühe in einen sauberen Projektfluss gesteckt. Der Code wird \\\",\\\"intensiv getestet, sowohl mit Unit- als auch mit Integrationtests, und mithilfe einer \\\",\\\"<i>Continuous Integration Pipeline</i> wird sicher gestellt, dass der Code die definierten \\\",\\\"Standards einhält. Zusätzlich dazu können neue Versionen automatisch eingespielt werden. \\\",\\\"Um hier einen flüssigen Übergang zu gewährleisten, werden neue Funktionalitäten erstmal\\\",\\\"als <i>Alpha</i> und <i>Beta</i> Version getestet bevor sie endgültig veröffentlicht wird. \\\",\\\"Außerdem werden durch Migrationen sicher gestellt, dass Benutzerdaten beim Versionswechsel nicht \\\",\\\"verloren gehen und sich automatisch Änderungen an der Datenbankstruktur anpassen.</p>\\\",\\\"<p>Für diese Projekt habe ich eine <strong>Droplet (Server)</strong> von <3>DigitalOcean</3>, \\\",\\\"auf der anfänglich nur Ubuntu ist, von Grund auf aufgebaut. \\\"]}},\\\"trutzbox\\\":{\\\"description\\\":{\\\"title\\\":\\\"Beschreibung\\\",\\\"content\\\":[\\\"<p>Das war meine erste Stelle als Entwickler. Die Firma Comidio GmbH. verkauft ein kleines Gerät \\\",\\\"names TrutzBox. Mit hilfe von Content Filtern, Bearbeitung von HTTP Packeten, und anderen Tricks, \\\",\\\"versucht diese die eigene Internetbenutzung möglichst weit zu anonymisieren. Der große Vorteil \\\",\\\"dieses Gerätes ist, dass man mithörende Geräte wie Smart TVs daran anschließen kann und auch diese \\\",\\\"teilweise kontrollieren kann. Meine Aufgabe war es, die veraltete UI der TrutzBox mit hilfe von \\\",\\\"ReactJS in die heutige Zeit zu bringen. Das Projekt war mein erstes großes React Projekt und \\\",\\\"ich habe dadurch viel Erfahrung in der Frontend Entwicklung mit React gesammelt.</p>\\\",\\\"<p>Da die alte Version nicht mit React geschrieben wurde, musste ich alle Seiten, die die alte \\\",\\\"Benutzeroberfläche anbietet, komplett neu in React schreiben, und, da jegliche Dokumentation \\\",\\\"gefehlt hat, mir selbst herleiten wie alles funktioniert. Zusätzlich sollten neue Funktionen \\\",\\\"eingebaut werden und die Oberfläche intuitiver gestaltet werden. Die größten Herausforderungen \\\",\\\"waren das Verwalten des Zustands, die Integration mit dem Backend, das Realisieren von einer \\\",\\\"Tabelle, bei der die Daten in Echtzeit (mithilfe von Websockets) aktualisiert werden, und \\\",\\\"das Einbauen von Echtzeitgraphen.</p>\\\"]}},\\\"norona\\\":{\\\"description\\\":{\\\"title\\\":\\\"Beschreibung\\\",\\\"content\\\":[\\\"Zwischen dem Anfang der Corona Pandemie und der weitflächigen Etablierung von staatlichen \\\",\\\"Kontaktverfolgungsapps hatte ich ein Projektpraktikum des Fachbereichs \\\\\\\"Telekooperation\\\\\\\" \\\",\\\"belegt. Das Thema war, eine eigene Kontaktverfolgungsapp in Kleingruppen zu entwickeln. \\\",\\\"Uns wurden ein paar Grundfunktionalitäten vorgegeben, sowie die Kontaktverfolgung, oder eine \\\",\\\"Kartensicht, auf der man seinen Standortverlauf sehen kann, aber ansonsten konnten \\\",\\\"wir noch beliebige Funktionalitäten hinzufügen. Wir wollten eine möglichste umfangreiche App \\\",\\\"entwickeln und bei uns war der Fokus vor allem auf die Privatsphäre der Benutzer.\\\"]},\\\"tracing\\\":{\\\"title\\\":\\\"Kontaktverfolgung\\\",\\\"content\\\":[\\\"Wie vorgegeben haben wie Kontaktverfolgung in die App eingebaut. Da es zum Beginn der \\\",\\\"Entwicklung noch keine offiziellen Kontaktverfolgungsapps gab, haben wir unser eigenes System \\\",\\\"entwickelt, welches sogar einem ähnliches Konzept wie die \\\\\\\"Corona-Warn-App\\\\\\\" benutzt hat. Also \\\",\\\"ein Gerät sendet mit Bluetooth LE in regelmäßigen Abständen eine ID, die sich auch regelmäßig \\\",\\\"ändert. Wenn man erkrankt, kann man das in die App eintragen und die Liste alle eigener IDs der\\\",\\\"letzten 2 Wochen wird hochgeladen. Jede App speichert sich alle IDs die sie länger als 5 Minuten \\\",\\\"gesehen hat und überprüft circa jeden Tag ob es einen Kontakt gab. Wir haben zusätzlich \\\",\\\"noch einen Grad des Kontakt eingebaut, also wenn eine Person nur Kontakt mit einer Person hatte, \\\",\\\"die Kontakt mit einer erkrankten Person hatte, dann ist der Grad des Kontakt geringer. Dadurch \\\",\\\"war es sogar möglich Infizierungsketten zu sehen.\\\"]},\\\"maps\\\":{\\\"title\\\":\\\"Karten\\\",\\\"content\\\":[\\\"Zusätzlich zu einer Karte, in der man seinen eigenen Standortsverlauf sehen konnte haben wir \\\",\\\"noch zwei weitere Ansichten eingebaut. Die erste war eine Heatmap, in der dargestellt wurde, wo \\\",\\\"sich gerade viele Leute befinden. Der Gedanke war, dass man so diese Gebiete umgehen kann, um \\\",\\\"so einen potentiellen Kontakt zu vermeiden. Die zweite war eine Ansicht aller Supermärkte. \\\",\\\"Hier wurde jeder Supermarkt markiert und wenn man drauf klickt, konnte man sich anschauen \\\",\\\"welche Lebensmittel noch verfügbar sind.\\\"]},\\\"giveAndReceive\\\":{\\\"title\\\":\\\"Hilfe geben/bekommen\\\",\\\"content\\\":[\\\"Mit dieser Funktionalität konnte man Benutzer in der Umgebung um Lebensmittel und sonstigen \\\",\\\"bitten oder angeben, dass man Lebensmittel zu verschenken hat. Um die Privatsphäre zu beschützen \\\",\\\"kann man nur einen Umkreis einstellen, in dem man solche Anfragen sehen kann und man weiß nicht \\\",\\\"genau, wo der Benutzer ist. Den genauen Standort und weitere Sachen, konnte man dann über den \\\",\\\"Realtime Messenger klären, den wir eingebaut haben.\\\"]},\\\"rulesOverview\\\":{\\\"title\\\":\\\"Regeln- und Nachrichtenüberblick\\\",\\\"content\\\":[\\\"Vor allem am Anfang zu Corona war es schwer einen Überblick über die aktuellen Regeln und \\\",\\\"Nachrichten zu bekommen. Deswegen haben wir zwei wichtige Funktionalitäten eingebaut. Die \\\",\\\"erste war eine Deutschlandkarte, die einem für jedes Bundesland an die aktuelle öffentliche \\\",\\\"Webseite weiterleitet. Die zweite war eine Echtzeitliste, die von unterschiedlichen \\\",\\\"Nachrichtenquellen die aktuellen Coronanachrichten anzeigt.\\\"]},\\\"technologies\\\":{\\\"title\\\":\\\"Entwicklung & Technologien\\\",\\\"content\\\":[\\\"<p>Zur Entwicklung hatten wir einen agilen Entwicklungsansatz benutzt, in dem wir in \\\",\\\"zweiwöchentlichen Sprints neue Funktionalitäten entwickelt und getestet habe um am Ende \\\",\\\"jedes Prints einen neuen Release zu haben.</p>\\\",\\\"<p>Die App hatten wir hauptsächlich mit Flutter geschrieben, wobei wir an manchen Stellen \\\",\\\"mit selbst geschrieben Android Java Code mit hilfe von Channels kommunizieren mussten. \\\",\\\"Den Server hatten wir mit ExpressJS geschrieben und mussten Authentifizierung einbauen, \\\",\\\"sowie mit Websockets und dem Datenbanksystem MongoDB arbeiten.</p>\\\"]}},\\\"webide\\\":{\\\"description\\\":{\\\"title\\\":\\\"Beschreibung\\\",\\\"content\\\":[\\\"Dieses Projekt entstand im Kontext des Moduls \\\\\\\"Bachelor Praktikum\\\\\\\" für die wissenschaftliche \\\",\\\"Projekt <0>ETA-Fabrik</0> der TU-Darmstadt. Ein sehr interessantes Projekt, in dem geforscht \\\",\\\"wurde, wie man eine Fabrik durch verbinden der Maschinen effizienter gestalten kann. Da dort \\\",\\\"mit einer großen Menge an Daten gearbeitet wurde, haben die Mitarbeiter viel mit Python und \\\",\\\"Bibliotheken wie <1>Matplotlib</1> gearbeitet. Um deren Arbeit zu beschleunigen, war es die \\\",\\\"Aufgabe von meiner Gruppe und mir eine Python Web IDE zu bauen, welche genutzt werden kann \\\",\\\"um lange, aufwendige oder wiederkehrende Programme auszuführen, und auch um diese zu schreiben. \\\",\\\"Somit musste unsere IDE die Programme ausführen können, native Unterstützung für Matplotlib haben \\\",\\\"und das Einrichten von regelmäßigen Jobs unterstützen.\\\"]},\\\"functionalities\\\":{\\\"title\\\":\\\"Funktionalitäten\\\",\\\"content\\\":[]}}},\\\"cv\\\":{\\\"title\\\":\\\"Lebenslauf\\\",\\\"type\\\":{\\\"abitur\\\":\\\"Abitur\\\",\\\"minijob\\\":\\\"Minijob\\\",\\\"bachelor\\\":\\\"B. Sc. Informatik\\\",\\\"master\\\":\\\"M. Sc. IT-Sicherheit\\\",\\\"hiwi\\\":\\\"Studentische Hilfskraft\\\",\\\"freelance\\\":\\\"Freiberuflich\\\"},\\\"noDate\\\":\\\"bis heute\\\",\\\"abitur\\\":{\\\"title\\\":\\\"Gutenberg Gymnasium Mainz\\\",\\\"description\\\":\\\"Leistungskurse:<list><item>Mathematik</item><item>Physik</item><item>Englisch</item></list><br/>Note: <b>2,4</b>\\\"},\\\"moebelmartin\\\":{\\\"title\\\":\\\"Möbel Martin\\\",\\\"description\\\":\\\"Meine Aufgabe bestand daraus, für Kunden Möbel aus dem Lager zu holen\\\"},\\\"bachelor\\\":{\\\"title\\\":\\\"TU Darmstadt\\\",\\\"description\\\":\\\"Wahlbereiche: <list><item>Robotik</item><item>IT-Sicherheit</item><item>Web-, Knowledge- and Information Processing</item></list><br/><b>Thema der Bachelorarbeit:</b> Erstellung eines IT-Sicherheit Web Corpus<br/><b>Note:</b> 1.6\\\"},\\\"trutzbox\\\":{\\\"title\\\":\\\"Comidio GmbH\\\",\\\"description\\\":\\\"Frontend Entwickler für das Admin Interface der TrutzBox. Veraltete Frontend wurde von mir von Grund auf in ReactJs in einem modernen Style neu aufgebaut\\\"},\\\"c++\\\":{\\\"title\\\":\\\"TU Darmstadt - C/C++ Programmierpraktikum\\\",\\\"description\\\":\\\"In einem Team haben wir neue Übungsaufgaben erstellt um Studenten saubere Entwicklung mit C/C++ beizubringen\\\"},\\\"psaf\\\":{\\\"title\\\":\\\"TU Darmstadt - Projektseminar Autonomes Fahren\\\",\\\"description\\\":\\\"Als studentische Hilfskraft bin ich hier Ansprechpartner für die Studenten, sowie für die Wartung und Weiterentwicklung der benutzten Autos und Software zuständig. Automatisierung, Debugging, Bugfixing, und Dokumentation schreiben gehört zu meinen Aufgaben\\\"},\\\"master\\\":{\\\"title\\\":\\\"TU Darmstadt\\\",\\\"description\\\":\\\"Mein derzeitiges Studium über IT-Sicherheit. Hier lerne ich von Informationssicherheitssystemen, über technische System und Softwaresicherheit bis zu moderner Kryptographie, eine Menge über IT-Sicherheit.\\\"},\\\"revealAll\\\":\\\"Alles zeigen\\\"},\\\"links\\\":{\\\"github\\\":\\\"GitHub\\\",\\\"group-car\\\":\\\"Schau dir das Projekt an\\\"},\\\"legal\\\":{\\\"title\\\":\\\"Legales\\\"},\\\"imprint\\\":{\\\"title\\\":\\\"Impressum\\\",\\\"phone\\\":\\\"Telefon\\\",\\\"telefax\\\":\\\"Telefax\\\",\\\"mail\\\":\\\"E-Mail\\\",\\\"contact\\\":\\\"Kontakt\\\"},\\\"privacyPolicy\\\":{\\\"title\\\":\\\"Datenschutzerklärung\\\"},\\\"switchTheme\\\":\\\"Farbthema wechseln\\\",\\\"changeLanguage\\\":\\\"Sprache ändern\\\",\\\"nextPage\\\":\\\"Zur nächsten Seite\\\",\\\"previousPage\\\":\\\"Zur vorherigen Seite\\\",\\\"toPage\\\":\\\"Zu Seite {{page}}\\\",\\\"misc\\\":{\\\"swipe\\\":\\\"Wische zur nächsten Seite\\\"}}\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJzb3VyY2VzIjpbXSwibmFtZXMiOltdLCJtYXBwaW5ncyI6IiIsImZpbGUiOiIuL3B1YmxpYy9sb2NhbGVzL2RlLmpzb24uanMiLCJzb3VyY2VSb290IjoiIn0=\n//# sourceURL=webpack-internal:///./public/locales/de.json\n");

